import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import Main from './components/Main.js';

function App() {
    return (
        <BrowserRouter>
            <Main style={{backgroundColor: '#f8f9fa', height: '100%'}} />
        </BrowserRouter>
    );
}

export default App;
